import React, {  useState } from 'react';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, Collapse, Divider, Box, Typography } from '@mui/material';

import { ExpandMore, ExpandLess } from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';
import "../styles/SideMenu.css";


const Sidebar = () => {
  const [expandedMenu, setExpandedMenu] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();

  const menuItems = [
    {
      id: 'Basic Information',
      label: 'Basic Information',
      hasSubMenu: true,
      subItems: [

        { id: 'TransferCertificate', label: 'TransferCertificate', path: '/' },

      ]
    },

    {
      id: 'Nursing(Bsc)-4YDC',
      label: 'Nursing(Bsc)-4YDC',
      hasSubMenu: true,
      subItems: [


        { id: 'Paragraph6', label: 'Semester 1', path: '/para6' },
        { id: 'Paragraph7', label: 'Semester 3', path: '/para7' },
        { id: 'Nursing4Semester', label: 'Semester 4', path: '/para14' },
      ]
    },
    { 
      id:'Nursing(Bsc)',
      label:'Nursing(Bsc)',
      hasSubMenu:true,
      subItems: [
        { id: 'Paragraph1', label: ' NursingSecondyear', path: '/para1' },
        { id: 'Paragraph2', label: 'NursingThirdrdyear'  , path: '/para2' },
        { id: 'Paragraph3', label: 'NursingFourthyear' , path: '/para3' },
      ]
    },

    {
      id: 'Physiotherapy(BPT)',
      label: 'Physiotherapy(BPT)',
      hasSubMenu: true,
      subItems: [

        { id: 'Paragraph4', label: 'Semester 1', path: '/para4' },
        { id: 'Paragraph5', label: 'Semester 2', path: '/para5' },
        { id: 'BPT43Semester', label: 'Semester 3', path: '/para8' },
      { id: 'BPT4Semester', label: 'Semester 4', path: '/para9' },
      { id: 'BPT5Semester', label: 'Semester 5', path: '/para10' },
      { id: 'BPT6Semester', label: 'Semester 6', path: '/para11' },
      { id: 'BPT7Semester', label: 'Semester 7', path: '/para12' },
      { id: 'BPT8Semester', label: 'Semester 8', path: '/para13' },

      ]
    },

    { 
      id:'Anesthesia(Bsc)',
      label:'Anesthesia(Bsc)',
      hasSubMenu:true,
      subItems: [
        { id: 'AnesthesiaFirstYear', label: 'AnesthesiaFirstYear', path: '/para15' },
        { id: 'AnesthesiaSecondYear', label: 'AnesthesiaSecondYear', path: '/para17' },
        { id: 'MLTSecondYear', label: 'MLTSecondYear', path: '/para16' },
        {id:'AnesthesiaThirdYear' , label:'AnesthesiaThirdYear', path:'/para18'},
        { id: 'MLTThirdYear', label: 'MLTThirdYear', path: '/para19' },

      ]
    },

    { 
      id:'HospitalManagementCourse',
      label:'HospitalManagementCourse',
      hasSubMenu:true,
      subItems: [
        { id: 'HMCFirstYearSemester1', label: ' HMCFirstYearSemester1', path: '/para20' },
        { id: 'HMCFirstYearSemester2', label: ' HMCFirstYearSemester2', path: '/para21' },
        { id: 'HMCSecondYearSemester3', label: ' HMCSecondYearSemester3', path: '/para22' },
        { id: 'HMCSecondYearSemester4', label: ' HMCSecondYearSemester4', path: '/para23' },


      ]
    },

  ];

  const handleMenuClick = (item) => {
    if(item.hasSubMenu) {
      setExpandedMenu(expandedMenu === item.id ? null : item.id);
    }
    else{
      handleNavigation(item.path);
    }
  };

  const handleNavigation = (path) => {
    navigate(path);
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <Drawer variant="permanent" className = "custom-drawer">
      <Box sx={{ overflow: 'auto' }}>
        <List>
          {menuItems.map((item) => (
            <React.Fragment key={item.id}>
              <ListItem button onClick={() => handleMenuClick(item)} selected={!item.hasSubMenu && isActive(item.path) || 
                  (item.hasSubMenu && item.subItems.some(sub => isActive(sub.path)))} className = "listitem_hover"
              >
                <ListItemText primary={item.label} className = "listitem_label" />
                  {item.hasSubMenu && ( expandedMenu === item.id ? <ExpandLess /> : <ExpandMore /> )}
                </ListItem>
                {item.hasSubMenu && (
                  <Collapse in={expandedMenu === item.id} timeout="auto" unmountOnExit>
                    <List component="div" disablePadding sx = {{backgroundColor : "#ede0fe"}}>
                      {item.subItems.map((subItem) => (
                        <ListItem key={subItem.id} button sx={{ pl: 4 }} onClick={() => handleNavigation(subItem.path)}
                          selected={isActive(subItem.path)} className = "listitem_hover">
                          <ListItemText primary={subItem.label} />
                        </ListItem>
                      ))}
                    </List>
                  </Collapse>
                )}
            </React.Fragment>
          ))}
        </List>
      </Box>
    </Drawer>
  );
};

export default React.memo(Sidebar);
